var blogText = document.getElementById('spBlogText');
var blogReplaceButton = document.createElement('input');
blogReplaceButton.value = "编辑HTML";
blogReplaceButton.setAttribute('type', 'button');
blogText.parentNode.insertBefore(blogReplaceButton, blogText.nextSibling);
var linebreak = document.createElement('br');
blogReplaceButton.parentNode.insertBefore(linebreak, blogReplaceButton.nextSibling);

function ReplaceButtonOnClick() {
  if(!confirm("请问您确定要使用TextArea编辑吗？\n\n\
    您的刚编辑的内容将会丢失！\n\n\
    请按“确定”以继续，或者按“取消”回到当前页。")) return;
  blogReplaceButton.style.display = 'none';
  blogText.setAttribute('name', 'spNoname');
  document.getElementById('spBlogText___Frame').style.display = 'none';
  var blogTextArea = document.createElement('textarea');
  linebreak.parentNode.insertBefore(blogTextArea, linebreak.nextSibling);
  blogTextArea.value = blogText.value;
  blogTextArea.setAttribute('name', 'spBlogText');
  blogTextArea.setAttribute('style', 'height: 300px !important;\
    width: 690px !important;');
    
  var blogPreviewContainer = document.createElement('div');
  blogPreviewContainer.setAttribute('id', 'm_blog');
  blogPreviewContainer.setAttribute('class', 'modbox');
  blogPreviewContainer.setAttribute('style', 'padding: 10px; border: 1px solid');
  var blogPreviewContent = document.createElement('div');
  blogPreviewContainer.appendChild(blogPreviewContent);
  blogPreviewContainer.setAttribute('class', 'cnt');
  blogPreviewContainer.style.display = 'none';
  linebreak.parentNode.insertBefore(blogPreviewContainer, linebreak.nextSibling);

  var blogPreviewButton = document.createElement('input');
  blogPreviewButton.value = "预览";
  blogPreviewButton.setAttribute('type', 'button');
  linebreak.parentNode.insertBefore(blogPreviewButton, linebreak);
  var blogEditButton = document.createElement('input');
  blogEditButton.value = "返回编辑 <<";
  blogEditButton.setAttribute('type', 'button');
  blogEditButton.style.display = 'none';
  linebreak.parentNode.insertBefore(blogEditButton, linebreak);
  var blogHilitButton = document.createElement('input');
  blogHilitButton.value = "应用代码着色到HTML";
  blogHilitButton.setAttribute('type', 'button');
  blogHilitButton.style.display = 'none';
  linebreak.parentNode.insertBefore(blogHilitButton, linebreak);

  function PreviewButtonOnClick () {
    blogTextArea.style.display = 'none';
    blogPreviewButton.style.display = 'none';
    blogPreviewContainer.innerHTML = blogTextArea.value;
    blogPreviewContainer.style.display = '';
    blogEditButton.style.display = '';
    blogHilitButton.style.display = '';
    prettyPrint();
    sh_highlightDocument();
  }
  
  function EditButtonOnClick () {
    blogEditButton.style.display = 'none';
    blogHilitButton.style.display = 'none';
    blogPreviewContainer.style.display = 'none';
    blogTextArea.style.display = '';
    blogPreviewButton.style.display = '';
  }
  
  function HilitButtonOnClick () {
    blogTextArea.value = blogPreviewContainer.innerHTML;
  }
  
  blogPreviewButton.addEventListener('click', PreviewButtonOnClick, false);
  blogEditButton.addEventListener('click', EditButtonOnClick, false);
  blogHilitButton.addEventListener('click', HilitButtonOnClick, false);
  
};

blogReplaceButton.addEventListener('click', ReplaceButtonOnClick, false);
/* end */

// ==/UserScript==

